import React from 'react'
import {Outlet, Navigate} from 'react-router-dom'

function PrivateProtect() {
  let auth = {'token': true}
  return (
        !auth.token ? <Outlet/> :  <Navigate to="/home"/>
  )
}

export default PrivateProtect
